script: |
  super -f text -I q11820.spq | sort > q11820.out

inputs:
  - name: q11820.spq
    data: |
      SELECT DISTINCT - 68 AS col0 FROM tab2 (FORMAT parquet) WHERE NOT NULL BETWEEN col2 * + - col1 * - CAST ( NULL AS INTEGER ) * col1 AND + + col0;
  - name: tab2

outputs:
  - name: q11820.out
    data: |
